import onboarding from "../images/onboarding.jpg";
import "./onboarding.css";
const Onboarding1 = () => {
  return (
    <div className="container flex flex-col">
      <div className="header flex-row justify-around ">
        Every Place has a Story to Tell
      </div>
      <button className="cta bg-[#E67019] w-10">Get Started</button>
    </div>
  );
};

export default Onboarding1;
